.temp-box {
    border: 1px solid #d3dae0;
    margin: 10px;
    .temp-title {
        padding: 10px;
        .title {
            display: flex;
            align-items: center;
            justify-content: space-between;
            h4 {
                margin: 10px;
            }
            .info {
                span {
                    font-size: 12px;
                    font-weight: 500;
                }
            }
        }
    }
}
.project-list {
    background-color: #efefef;
    padding: 10px;
    transition: all 0.5s linear;
    -moz-transition: width all 0.5s linear; /* Firefox 4 */
    -webkit-transition: width all 0.5s linear; /* Safari and Chrome */
    -o-transition: width all 0.5s linear; /* Opera */
    .project-title {
        padding: 10px 0;
        span {
            i {
                color: skyblue;
            }
            i.icon {
                display: inline-block;
                width: 5px;
                height: 5px;
                border-radius: 50%;
                background-color: #13ce66;
            }
        }
    }
    .project-info {
        span {
            display: flex;
            align-items: center;
            font-size: 12px;
        }
    }
    &:hover {
        border-radius: 15px;
        box-shadow: 5px 5px 8px 1px #e4e7ed, 1px 1px 0px 2px #ffffff;
    }
}
.flex {
    display: flex;
    justify-content: space-between;
}
